        </Grid>
      </Grid>
      <Grid item>
      {imageListSrc.map((item: OptionType, index: number) => { 
return(
    <Grid item >

<SidePanelItem iconUrl={item.src}  classname={classes.Item} text={item.text}></SidePanelItem>

</Grid>
)})}
      </Grid>


    </Grid>
  )
}
